import React from "react";
import Navbar from "./components/Navbar";
import Filter from "./components/Filter";
import Cards from "./components/Cards";
import { filterData,apiUrl } from "./data";

const App = () => {
  return(
    <div>
      <div>
        <Navbar/>
      </div>
      <div>
        <Filter filterData={filterData}/> 
      </div>
      <div>
        <Cards/>
      </div>
    </div>
    
  );
};

export default App;
